$(function(){$(".screenshotframe").dialog({autoOpen:!1,draggable:!1,resizable:!1,show:"clip",hide:"clip",speed:"fast",closeOnEscape:!0,width:790,height:"auto",title:"X"});$("#maincontent").accordion({heightStyle:"content",animate:"easeOutCubic"});$("#headercontent").click(function(){$("#maincontent").accordion("option","active",0)});$(".sect_head").on("click",function(){ga("send","event","section_nav",this.id)});$(".projtitle").click(function(){displayFull(this.id);ga("send","event","project_disp",
this.id)})});$(document).ready(function(){drawSkills("skills");displayFull("sif")});function showDialog(a){$("#"+a).dialog("open");$("#"+a).click(function(a){a.stopPropagation()});ga("send","event","dialog_open",a)}function hideDialog(a){$("#"+a).dialog("close")}
function displayFull(a){var d=$("#"+a+"txtfull").html();$("#projectdetails").html(d);$("h2.projtitle").removeClass("whiteonblue").addClass("blueonwhite");$("#"+a).addClass("whiteonblue");$("body").click(function(){hideDialog(a+"frame")});$("#"+a+"screen").click(function(b){b.stopPropagation();showDialog(a+"frame")})}
function drawSkills(a){for(var d=[["Java",5],["Ruby",4],["JavaScript",4],["Scala",3],["PHP",4],["Lua",2],["C++",2],["C#",2],["Perl",2],["MySQL",5],["MongoDB",3],["JSP",2],["jQuery",4],["Play",2],["Rails",3]],b="",c=0;c<d.length;c++)b+=drawSkill(d[c][0],d[c][1]);$("#"+a).html(b)}
function drawSkill(a,d){for(var b='<div class="skill"><span class="skill-name">'+a+'</span><div class="skills-exp">',c=0;5>c;c++)b=d>c?b+'<div class="box filled"></div>':b+'<div class="box"></div>';return b+"</div></div>"};